Actionscript.script:
_parent.UpdateBigSmallState("技能中","瞬步斩一段中");


轻型武器攻击搓招 = _root.技能函数.轻型武器攻击搓招;
大型武器攻击搓招 = _root.技能函数.大型武器攻击搓招;
剑气释放搓招窗口 = _root.技能函数.剑气释放搓招窗口;
飞沙走石搓招窗口 = _root.技能函数.飞沙走石搓招窗口;
贯穿突刺搓招窗口 = _root.技能函数.贯穿突刺搓招窗口;
蓄力重劈搓招窗口 = _root.技能函数.蓄力重劈搓招窗口;
十六夜月华可派生 = _root.技能函数.十六夜月华可派生;
百万突刺可派生 = _root.技能函数.百万突刺可派生;
粉碎切割可派生 = _root.技能函数.粉碎切割可派生;
猎影十字可派生 = _root.技能函数.猎影十字可派生;
次元斩可派生 = _root.技能函数.次元斩可派生;
月光斩可派生 = _root.技能函数.月光斩可派生;
见切可派生 = _root.技能函数.见切可派生;

_parent.UpdateBigSmallState("技能中","瞬步斩结束");
//_parent.动画完毕();
_root.技能路由.动画完毕(this,_parent);

onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{_parent.猎影十字可派生();}
}

if(_parent.性别 == "女")
{
	_parent.攻击呐喊();
}
else
{
	_root.播放音效("青年冷峻-打斗11_01.wav");
}
_root.播放音效("黑闪.wav");

_parent.UpdateSmallState("贯穿突刺中");

瞬步斩攻击 = _root.技能函数.瞬步斩攻击;

function 消弹()
{
	var 消弹属性 = _root.消弹属性初始化(this.攻击点);
	消弹属性.消弹方向 = _parent.方向 == "右" ? "左" : "右";
	消弹属性.Z轴攻击范围 = 30;
	消弹属性.区域定位area = this.攻击点;

	_root.消除子弹(消弹属性);
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);
	自机 = _parent._parent;
	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 =  自机.空手攻击力 / 5 + 自机.刀属性.power * 3;
	if (自机.mp攻击加成 && 自机.等级 >= 10)
	{子弹属性.子弹威力 += 自机.mp攻击加成 * 1;}
	if(自机.被动技能.刀剑攻击 && 自机.被动技能.刀剑攻击.等级 && 自机.等级 >= 15)
	{
		子弹属性.子弹威力 *= 1 + 自机.被动技能.刀剑攻击.等级 / 13;
	}
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;
	//子弹属性.不硬直 = true;
	子弹属性.水平击退速度 = 12;
	子弹属性.击中后子弹的效果 = "斩打命中特效";

	//非常用
	/*
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

