	_parent.攻击时可改变移动方向(60);
}

onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{
		_parent.轻型武器攻击搓招();
	}
}

X轴追踪移动 = _root.敌人二级函数.X轴追踪移动;
Z轴追踪移动 = _root.敌人二级函数.Z轴追踪移动;
_parent.UpdateSmallState("猎影十字开始");

var 索敌距离 = 550;
var 是否强行重新索敌 = true;
var 优先索敌属性 = "距离";
var 优先索敌排序 = "顺序";
var 是否追踪 = true;
var 敌人顺序 = 0;
if(_root.控制目标 == _parent._name){
	//if(Key.isDown(_root.武器变形键)){
		//是否强行重新索敌 = true;
	//}
	if(Key.isDown(_root.互动键)){
		优先索敌属性 = "血量";
		优先索敌排序 = "倒序";
	}
	if(Key.isDown(_root.奔跑键)){
		是否追踪 = false;
	}
}
var 追踪目标 = _parent.按距离索敌(索敌距离, 是否强行重新索敌, 优先索敌属性, 优先索敌排序);
if(!追踪目标){
	是否追踪 = false;
}

shootX = _root.gameworld[_parent.追踪目标]._x;
shootY = _root.gameworld[_parent.追踪目标]._y;
shootZ = _root.gameworld[_parent.追踪目标].Z轴坐标;

onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{_parent.贯穿突刺搓招窗口();}
}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_parent._parent.技能浮空 == true)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 && !_parent.落地)
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
